  return (
    <div className={`frame-3593 ${className || ""}`}>
      <EditList_ul editList_Ul={editList_ulProps.editList_Ul} />
      <div className="text-16 ibmplexsans-semi-bold-quarter-spanish-white-16px">{text16}</div>
    </div>
  );
}

export default Frame3593;
